import React, { useState } from 'react';
import LoginPage from './LoginPage';
import ParkingLotOwnerPage from './ParkingLotOwnerPage';
import UserPage from './UserPage';

const App = () => {
  const [loginType, setLoginType] = useState(''); // 'owner' or 'user'

  const handleLogin = (type) => {
    setLoginType(type); // Set the type after login
  };

  return (
    <>
      {loginType === '' && <LoginPage onLogin={handleLogin} />}
      {loginType === 'owner' && <ParkingLotOwnerPage />}
      {loginType === 'user' && <UserPage />}
    </>
  );
};

export default App;
